LAHORE, Oct 30 (APP): Caretaker Prime Minister Anwaar-ul-Haq Kakar on Monday arrived here on a two-day visit.
Governor Punjab Balighur Rahman, Caretaker Chief Minister Syed Mohsin Naqvi and provincial authorities received the prime minister on the airport, PM Office Media Wing said in a press release.
